import { useEffect, useState } from "react"
import { fetchAllStudentWorksheets } from "./services/worksheetServices"

export const ReviewWorksheets = () => {

    const [studentWorksheets, setStudentWorksheets] = useState([])

    const fetchCalls = () => {
        fetchAllStudentWorksheets().then((data) => {
            const filterStudentWorksheets = data.filter((datum) => datum.isComplete === true)
            console.log("ðŸš€ ~ file: ReviewWorksheets.js:11 ~ fetchAllStudentWorksheets ~ filterStudentWorksheets:", filterStudentWorksheets)
            setStudentWorksheets(filterStudentWorksheets)
        })
    }

    useEffect(() => {
        fetchCalls()
    }, [])

    return (
        <>
            <ul>
                {studentWorksheets.map((studentWorksheet) => {
                    return (
                        <li>
                            <p>{studentWorksheet?.worksheet?.title}</p>
                            {studentWorksheet?.studentAnswers}
                            <p></p>
                        </li>
                    )
                })}
                <button>Approve</button>
            </ul>
        </>
    )
}
